import axios from "axios";
import { axiosApi } from ".";
import { API_PATH } from "../../constants/path";
import { useNavigate } from "react-router-dom";

const requestAddBoard = async (title, content) => {
  await axios
    .post(API_PATH.POST, {
      title: title,
      content: content,
    })
    .then(() => {
      useNavigate("/");
    })
    .catch((error) => {
      console.error(error);
      if (!error) {
        alert(error);
      }
    });
};

export { requestAddBoard };
